import React, { useState } from 'react';
import './SearchBoxStyles.css';

import { connect } from 'react-redux';
import { change_pop_keyword } from '../../redux/pkeyword-action';


const mapDispatchToProps = dispatch => {
	return {
		change_pop_keywor: (p_kw) => dispatch(change_pop_keywork(p_kw))
	}
}

const PopSearchBox = (change_pop_keywork) => {
	const [PopKeyWords, setPopKeyWords] = useState("");

	return(
		<div id="cover">
		  <form method="get" action="">
		    <div className="tb">
		      <div className="td">
		      	<input 
		      		type="text" 
		      		placeholder="Search for Music" 
		      		onChange={event => setPopKeyWords(event.target.value)}
		      		required />
		      </div>
		      <div className="td" id="s-cover">
		        <button 
		        	type="submit"
		        	onClick={() => change_pop_keywork(PopKeyWords)}
		        >
		        	{console.log(PopKeyWords)}
		          <div id="s-circle"></div>
		          <span></span>
		        </button>
		      </div>
		    </div>
		  </form>
		</div>
	);
}


